import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function App(props) {
  return ( 
      <Container>
          <Jumbotron title='Hello 22-5KB'></Jumbotron>
          <Row>
              <Col4>
                  <Card>
                      <Greet who='22-5KB'></Greet>
                  </Card>
                  <DataReader id='258'>
                  </DataReader>
              </Col4>
          </Row>
      </Container>
  );
}

const comment = {
  date: new Date(),
  text: 'Tohle bzla fakt mrdacka',
  author: {
    name: 'Pejpej',
    avatarUrl: 'https://placekitten.com/g/64/64',
  },
};

ReactDOM.render(
  App,
  document.getElementById('root')
);
